import home from '../../images/icon/home.png';

function Footer(){
    return(
        <footer >
             <div class='footer-wrap'>
                <img src={home} alt="로고" />
            
                <p>오늘 뭐할까?</p>
            </div>
        </footer>
    )
}

export default Footer;
